import React from "react";
import ReactDOM from "react-dom";
import PouchDB from "pouchdb-browser";

import { Provider } from "use-pouchdb";

import App from "./App";

const db = new PouchDB("local");

ReactDOM.render(
  <Provider pouchdb={db}>
    <App />
  </Provider>,
  document.getElementById("root")
);
